var Barb = Barb || {};

Barb.ListingViewModes = (function () {

  // Selectors.
  var SELECTOR_VIEW_MODE_TOGGLE_VIEWS_WRAPPER = '[data-listing-view-mode-toggle]';

  // Attributes.
  var ATTR_DATA_VIEW_MODE = 'data-view-mode';

  // Classes.
  var CLASS_LIST_VIEW = 'list-view';
  var CLASS_ACTIVE = 'active';
  var CLASS_VIEW_MODE_TABS = 'view-mode-tabs';

  // Cookie names.
  var VIEW_MODE_COOKIE = 'listing-view-mode';

  // View modes.
  var VIEW_MODE_LIST = 'list';
  var VIEW_MODE_FULL = 'full';
  var VIEW_MODE_DEFAULT = VIEW_MODE_FULL;

  /**
   * Wrapper around the list items that the view mode class will be added to.
   *
   * @param jQuery
   */
  var $listWrapper;

  var self = {};

  /**
   * Initialize.
   *
   * @param {HTMLElement} context
   */
  self.init = function (context, settings) {
    $listWrapper = jQuery(SELECTOR_VIEW_MODE_TOGGLE_VIEWS_WRAPPER);
    // Add the tabs.
    $listWrapper.once().prepend(viewModeTabs());
    var currentSelection = getSelectedViewMode();
    setActiveTab(currentSelection);
    // Add the list view class if required.
    if (currentSelection == VIEW_MODE_LIST) {
      $listWrapper.addClass(CLASS_LIST_VIEW);
    }
    attachBehaviours();
  };

  /**
   * Attach behaviours.
   */
  var attachBehaviours = function () {
    bindViewModeTabBehaviour();
  };

  /**
   * Generate the tabs for switching view modes.
   *
   * @return jQuery
   */
  var viewModeTabs = function () {
    var $full = jQuery('<a />')
      .attr('href', '#')
      .attr(ATTR_DATA_VIEW_MODE, VIEW_MODE_FULL)
      .text('Full view')
    var $list = jQuery('<a />')
      .attr('href', '#')
      .attr(ATTR_DATA_VIEW_MODE, VIEW_MODE_LIST)
      .text('List view')
    var $tabs = jQuery('<div />')
      .addClass(CLASS_VIEW_MODE_TABS)
      .append($full)
      .append($list);
    return $tabs;
  }

  /**
   * Bind the behaviour for selecting a view mode.
   */
  function bindViewModeTabBehaviour() {
    jQuery('.' + CLASS_VIEW_MODE_TABS + ' a').once().on('click', function(e) {
      e.preventDefault();
      // Do not react if the current tab is active.
      if (jQuery(this).hasClass(CLASS_ACTIVE)) {
        return;
      }
      // Get the chosen view mode.
      var viewMode = jQuery(this).attr(ATTR_DATA_VIEW_MODE);
      setActiveTab(viewMode);
      // Set the cookie for a year.
      jQuery.cookie(VIEW_MODE_COOKIE, viewMode, {expires: 365, path: '/'});
      // Toggle the list view class.
      $listWrapper.toggleClass(CLASS_LIST_VIEW);
      // Refresh Waypoints, as the change in content heights affects things
      // like the sticky titles in results. Add a slight delay to allow any
      // animation/change in height to take effect.
      setTimeout(function() {
        Waypoint.refreshAll();
      }, 500);

    });
  }

  /**
   * Get the view mode a user has selected.
   *
   * Retrieves the value from their cookie, or the default if none set.
   *
   * @return string
   */
  function getSelectedViewMode() {
    var selected = jQuery.cookie(VIEW_MODE_COOKIE);
    return selected || VIEW_MODE_DEFAULT;
  }

  /**
   * Set the active tab in the view mode switcher.
   *
   * @param string tab
   */
  function setActiveTab(tab) {
    jQuery('.' + CLASS_VIEW_MODE_TABS + ' a').removeClass(CLASS_ACTIVE);
    jQuery('.' + CLASS_VIEW_MODE_TABS + ' a[' + ATTR_DATA_VIEW_MODE + '="' + tab + '"]').addClass(CLASS_ACTIVE);
  }

  return self;

})();

