var Barb = Barb || {};

Barb.BackgroundVideo = (function () {

  'use strict';

  var CLASS_NO_OBJECT_FIT = 'background-video--compact';
  var CLASS_IS_PLAYING = 'is-playing';
  var CLASS_HIDDEN = 'hidden';
  var SELECTOR_CONTROLS = '.video-button';
  var SELECTOR_PLAY = '.js-video-play';
  var SELECTOR_PAUSE = '.js-video-pause';

  var self = {};

  /**
   * Initialize the background video.
   *
   * @param context
   */
  self.init = function (context) {
    var $videos = jQuery('video[data-src]', context);

    if ($videos.length === 0 || !Barb.Breakpoint.isAboveMedium()) {
      return;
    }

    addSourceToVideos($videos);
  };

  /**
   * Reposition videos after they are loaded.
   *
   * In case object fit is not supported, we need to get the height of the video
   * and container and reposition the video so that it is vertically centred.
   *
   * @param {object} event
   *   Event object.
   */
  var repositionVideo = function (event) {
    if (Modernizr.objectfit) {
      return;
    }
    var $video = jQuery(event.target);
    $video.addClass(CLASS_NO_OBJECT_FIT);
    $video.css('top', (($video.parent().height() - $video.height()) / 2));

  };

  /**
   * Add source element to background videos.
   *
   * @param {jQuery} $videos
   *   Videos to add sources to.
   */
  var addSourceToVideos = function ($videos) {
    $videos.each(function () {
      var $video = jQuery(this);
      var $source = jQuery('<source />')
        .attr({
          src: $video.attr('data-src'),
          type: 'video/mp4'
        });
      $video.removeAttr('data-src').append($source);
      $video[0].play();
      $video.bind('loadeddata', repositionVideo);
      bindControls($video);
    });
  };

  /**
   * Bind controls element to background videos.
   *
   * @param {jQuery} $video
   *   Videos to add sources to.
   */
  var bindControls = function ($video) {
    var $buttons = jQuery(SELECTOR_CONTROLS, $video.parent());
    $buttons.addClass(CLASS_IS_PLAYING);
    var $play = jQuery(SELECTOR_PLAY, $buttons);
    var $pause = jQuery(SELECTOR_PAUSE, $buttons);
    $buttons.click(function () {
      $play.toggleClass(CLASS_HIDDEN);
      $pause.toggleClass(CLASS_HIDDEN);
      $buttons.hasClass(CLASS_IS_PLAYING) ? $video[0].pause() : $video[0].play();
      $buttons.toggleClass(CLASS_IS_PLAYING);
    });
  };

  return self;

})();

Drupal.behaviors.barbBackgroundVideo = {
  attach: function (context, settings) {
    Barb.BackgroundVideo.init(context);
  }
};

jQuery(window).bind('resize', function () {
  Barb.BackgroundVideo.init(document);
});
